import base64
from io import BytesIO
from PIL import Image
import torch
from ultralytics import YOLO


YOLO_MODEL = "yolov8n.pt"

PERSON_CLS_ID = 0
CONFIDENCE_THRESHOLD = 0.4

model = YOLO(YOLO_MODEL)


def str2img(s: str):
    bytes = BytesIO(base64.b64decode(s))
    return Image.open(bytes)


def is_room_empty(img_str: str) -> bool:
    device = 'cuda' if torch.cuda.is_available() else 'cpu'

    if not img_str:
        raise ValueError("Parameter img_str can not be None.")

    img = str2img(img_str)

    result = model(
        source=img,
        device=device,
        verbose=False,
        conf=CONFIDENCE_THRESHOLD,
        classes=[PERSON_CLS_ID]
    )[0]

    res_boxes = result.boxes.cls.tolist()

    print(f"Number of people: {len(result.boxes)}")

    is_person = lambda x: int(x) == PERSON_CLS_ID

    return not any(filter(is_person, res_boxes))


if __name__ == "__main__":
    import json

    img_test = ""
    #img_test = ""

    msg = "{\"img\":\"" + img_test + "\"}"
    content = json.loads(msg)
    img_str = content.get("img")
    print(f"ROOM IS EMPTY RESULT: {is_room_empty(img_str)}")

